import { JsonFragment } from "@ethersproject/abi";
import { ethers } from "ethers";
const ARACHNID_CREATE2_PROXY = "0x4e59b44847b379578588920ca78fbf26c0b4956c";

export function makeArachnidCreate2Txn(
  salt: string,
  initcode: ethers.BytesLike,
  arachnidAddress = ARACHNID_CREATE2_PROXY
): [ethers.TransactionRequest, string] {
  let saltHash = salt;
  if (!ethers.isBytesLike(salt) || salt.length != 66) {
    saltHash = ethers.keccak256(ethers.toUtf8Bytes(salt));
  }

  const txn = {
    to: arachnidAddress,
    data: saltHash + initcode.toString().slice(2),
  };

  const contractAddress =
    "0x" +
    ethers
      .keccak256(
        "0xff" +
          arachnidAddress.slice(2) +
          saltHash.slice(2) +
          ethers.keccak256(initcode).slice(2)
      )
      .slice(26);

  // ethers.getAddress will uppercase the address properly for checksum purposes
  return [txn, ethers.getAddress(contractAddress)];
}

