async function _contract({
  stepName,
  abi,
  bytecode,
  args = [],
  salt = "",
  create2 = false,
  signer,
}: {
  stepName: string;
  abi: JsonFragment[];
  bytecode: string;
  args?: any[];
  salt?: string;
  create2?: boolean;
  signer: ethers.Signer;
}) {
  console.log(`[${stepName}]`);
  const factory = new ethers.ContractFactory(abi, bytecode, signer);
  const txn = await factory.getDeployTransaction(...args);

  if (create2) {
    const [create2Txn, contractAddress] = makeArachnidCreate2Txn(
      salt,
      txn.data!
    );
    const tx = await signer.sendTransaction(create2Txn);
    await tx.wait();
    console.log(`  address: ${contractAddress}`);
    console.log(`  tx hash: ${tx.hash}`);
  } else {
    console.log(txn);
    const tx = await signer.sendTransaction(txn);
    const rx = await tx.wait();
    console.log(`  address: ${rx?.contractAddress}`);
    console.log(`  tx hash: ${rx?.hash}`);
  }
}

async function _invoke({
  stepName,
  to,
  data,
  value,
  signer,
}: {
  stepName: string;
  to: string;
  data: string;
  value: ethers.BigNumberish;
  signer: ethers.Signer;
}) {
  console.log(`[${stepName}]`);

  const tx = await signer.sendTransaction({ to, data, value });
  await tx.wait();

  console.log(`  tx hash: ${tx.hash}`);
}
